We note that as necessary, our model includes some simplifications. Most importantly, parameter values for mosquito population modeling come from controlled experiments performed in laboratory studies
49 . Clearly, it seems prohibitably challenging to directly estimate these parameters in the wild, as tracking individual mosquitoes is infeasible; studies can test the applicability of the models by comparing predictions to estimates of observed mosquito population sizes. Furthermore, accurately measuring mosquito populations itself present difficulties in real-world conditions. We note that uncertainties in parameters are inherently linked in our model; e.g. a shorter mosquito lifespan could be offset by higher bite rate as evident from Eq. 24. This way, any calibration process among the parameter values will likely be degenerate. Another main limitation in our dataset is that we have no estimate of any existing immunity to dengue in the population. While dengue has mulitple strains, and partial or full immunity can be acquired after being infected with a specific strain, the picture is quite complex. Similarly to uncertainty of parameters for mosquitoes, uncertainty in the size of susceptible population is linked to any variations in other parameters. For this reason, we do not perform a scaling of the population size, but use the sample obtained from the mobile phone data which covers a large part of Singapore’s population. We deal with these issues by using established values and temperature-dependent forms from the literature for most parameters
11, 14, 49 , while exploring a phase space determined by variations in a small number of parameters, namely the bite rate (
